import React, { Component } from 'react';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import ListSubheader from '@material-ui/core/ListSubheader';
import IconButton from '@material-ui/core/IconButton';
import InfoIcon from '@material-ui/icons/Info';
import Todo from './Todo';



class TodoList extends Component {
    constructor(props) {
      super(props);
      this.toDoListRemove = this.toDoListRemove.bind(this);
    }

    toDoListRemove(id) {
      //actual delete will happen in todoAPP
      this.props.toDoAppremoveTask(id);
    }

    render() {
      return React.createElement("ul", null, this.props.tasks.map(todo =>

        <div className={'root'}>
          <GridList cellHeight={180} className={'gridList'}>
            <GridListTile key="Subheader" cols={3} style={{ height: 'auto' }}>
            <Todo toDoListRemove= {this.toDoListRemove} key={todo.id} todo= {todo}/>
         </GridListTile>

          </GridList>
        </div>

        ));
    }

  }

  export default TodoList
